import React, { Component } from 'react';
import Router from './Router';
import './App.css';
import Page from './Page';

class App extends Component { 
  render() {
    const _content = [];
    _content.push(
      <div>Alo</div>
    );
    return (
      <div>
       <Page content="{{_content}}"></Page>
      </div>
    );
  }
}

export default App;
